def is_majority(arr, n, element):
    def first_occurrence(arr, low, high, x):
        if high >= low:
            mid = (low + high) // 2
            if (mid == 0 or x > arr[mid - 1]) and arr[mid] == x:
                return mid
            elif x > arr[mid]:
                return first_occurrence(arr, mid + 1, high, x)
            else:
                return first_occurrence(arr, low, mid - 1, x)
        return -1

    index = first_occurrence(arr, 0, n - 1, element)
    if index == -1:
        return False

    if (index + n // 2) < n and arr[index + n // 2] == element:
        return True
    return False

