def newman_prime(n):
    def is_prime(num):
        if num <= 1:
            return False
        if num <= 3:
            return True
        if num % 2 == 0 or num % 3 == 0:
            return False
        i = 5
        while i * i <= num:
            if num % i == 0 or num % (i + 2) == 0:
                return False
            i += 6
        return True

    def newman_shanks_williams_sequence(k):
        if k == 0 or k == 1:
            return 1
        a, b = 1, 1
        for _ in range(2, k + 1):
            a, b = b, 2 * b + a
        return b

    count = 0
    k = 0
    while count < n:
        num = newman_shanks_williams_sequence(k)
        if is_prime(num):
            count += 1
        k += 1
    return num

