def find_kth(arr1, arr2, k):
    def kth_util(a, b, k):
        if not a:
            return b[k]
        if not b:
            return a[k]
        mid_a, mid_b = len(a) // 2, len(b) // 2
        if mid_a + mid_b < k:
            if a[mid_a] > b[mid_b]:
                return kth_util(a, b[mid_b + 1:], k - mid_b - 1)
            else:
                return kth_util(a[mid_a + 1:], b, k - mid_a - 1)
        else:
            if a[mid_a] > b[mid_b]:
                return kth_util(a[:mid_a], b, k)
            else:
                return kth_util(a, b[:mid_b], k)

    return kth_util(arr1, arr2, k - 1)

