from collections import defaultdict

def largest_subset(nums):
    nums.sort()
    dp = defaultdict(int)
    max_size = 0

    for num in nums:
        max_subset_size = 0
        for factor in range(1, int(num**0.5) + 1):
            if num % factor == 0:
                max_subset_size = max(max_subset_size, dp[factor])
                if factor != num // factor:
                    max_subset_size = max(max_subset_size, dp[num // factor])
        dp[num] = max_subset_size + 1
        max_size = max(max_size, dp[num])

    return max_size

