def maxAverageOfPath(matrix):
    N = len(matrix)
    dp = [[(0, 0)] * N for _ in range(N)]
    dp[0][0] = (matrix[0][0], 1)

    for i in range(N):
        for j in range(N):
            if i == 0 and j == 0:
                continue
            if i > 0:
                sum_cost, count = dp[i-1][j]
                new_sum_cost = sum_cost + matrix[i][j]
                new_count = count + 1
                if new_sum_cost / new_count > dp[i][j][0] / dp[i][j][1]:
                    dp[i][j] = (new_sum_cost, new_count)
            if j > 0:
                sum_cost, count = dp[i][j-1]
                new_sum_cost = sum_cost + matrix[i][j]
                new_count = count + 1
                if new_sum_cost / new_count > dp[i][j][0] / dp[i][j][1]:
                    dp[i][j] = (new_sum_cost, new_count)

    total_cost, total_count = dp[N-1][N-1]
    return total_cost / total_count

