    current_length = 0
    balance = 0
    balance_dict = {0: -1}

    for i, char in enumerate(s):
        if char == '0':
            balance += 1
        else:
            balance -= 1

        if balance > 0:
            current_length = i + 1
            max_length = max(max_length, current_length)
        elif balance - 1 in balance_dict:
            current_length = i - balance_dict[balance - 1]
