def max_sub_array_sum_repeated(arr, n, k):
    def kadane(arr):
        max_ending_here = max_so_far = arr[0]
        for x in arr[1:]:
            max_ending_here = max(x, max_ending_here + x)
            max_so_far = max(max_so_far, max_ending_here)
        return max_so_far

    single_kadane = kadane(arr)
    if k == 1:
        return single_kadane

    total_sum = sum(arr)
    prefix_sum = suffix_sum = 0
    max_prefix_sum = max_suffix_sum = float('-inf')

    current_prefix_sum = 0
    for x in arr:
        current_prefix_sum += x
        max_prefix_sum = max(max_prefix_sum, current_prefix_sum)

    current_suffix_sum = 0
    for x in reversed(arr):
        current_suffix_sum += x
        max_suffix_sum = max(max_suffix_sum, current_suffix_sum)

    if total_sum > 0:
        return max(max_prefix_sum + max_suffix_sum + (k - 2) * total_sum, single_kadane)
    else:
        return max(max_prefix_sum + max_suffix_sum, single_kadane)

assert max_sub_array_sum_repeated([10, 20, -30, -1], 4, 3) == 30

