def count_Substrings(s):
    def digit_sum(sub):
        return sum(int(c) for c in sub)

    count = 0
    n = len(s)
    for i in range(n):
        for j in range(i + 1, n + 1):
            if digit_sum(s[i:j]) == j - i:
                count += 1
    return count

