def comb_sort(arr):
    def get_next_gap(gap):
        gap = (gap * 10) // 13
        return max(1, gap)

    n = len(arr)
    gap = n
    swapped = True

    while gap != 1 or swapped:
        gap = get_next_gap(gap)
        swapped = False

        for i in range(n - gap):
            if arr[i] > arr[i + gap]:
                arr[i], arr[i + gap] = arr[i + gap], arr[i]
                swapped = True

    return arr

assert comb_sort([5, 15, 37, 25, 79]) == [5, 15, 25, 37, 79]

