    non_zero_elements = len(lst) - zero_elements
    if non_zero_elements == 0:
        return float('inf')
    return zero_elements / non_zero_elements

assert math.isclose(zero_count([0, 1, 2, -1, -5, 6, 0, -3, -2, 3, 4, 6, 8]), 0.181818, rel_tol=0.001)

