def pancake_sort(arr):
    def flip(sublist, k):
        return sublist[:k][::-1] + sublist[k:]

    n = len(arr)
    for size in range(n, 1, -1):
        max_index = max(range(size), key=arr.__getitem__)
        if max_index != size - 1:
            arr = flip(arr, max_index + 1)
            arr = flip(arr, size)
    return arr

assert pancake_sort([15, 79, 25, 38, 69]) == [15, 25, 38, 69, 79]

