def check_occurences(tuples_list):
    occurrences = {}
    for t in tuples_list:
        sorted_t = tuple(sorted(t))
        if sorted_t in occurrences:
            occurrences[sorted_t] += 1
        else:
            occurrences[sorted_t] = 1
    return occurrences

assert check_occurences([(3, 1), (1, 3), (2, 5), (5, 2), (6, 3)]) == {(1, 3): 2, (2, 5): 2, (3, 6): 1}

