def max_sum(arr):
    n = len(arr)
    if n == 0:
        return 0

    inc = [0] * n
    dec = [0] * n

    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[j] < arr[i] and inc[i] < inc[j] + arr[i]:
                inc[i] = inc[j] + arr[i]

    for i in range(n - 1, -1, -1):
        dec[i] = arr[i]
        for j in range(n - 1, i, -1):
            if arr[j] < arr[i] and dec[i] < dec[j] + arr[i]:
                dec[i] = dec[j] + arr[i]

    max_sum = 0
    for i in range(n):
        max_sum = max(max_sum, inc[i] + dec[i] - arr[i])

    return max_sum

assert max_sum([1, 15, 51, 45, 33, 100, 12, 18, 9]) == 194

