import heapq

def large_product(list1, list2, n):
    max_heap = []
    for num1 in list1:
        for num2 in list2:
            product = num1 * num2
            if len(max_heap) < n:
                heapq.heappush(max_heap, product)
            else:
                heapq.heappushpop(max_heap, product)
    return sorted(max_heap, reverse=True)

assert large_product([1, 2, 3, 4, 5, 6], [3, 6, 8, 9, 10, 6], 3) == [60, 54, 50]

