def digit_distance_nums(num1, num2):
    str1, str2 = str(num1), str(num2)
    max_len = max(len(str1), len(str2))
    str1, str2 = str1.zfill(max_len), str2.zfill(max_len)
    return sum(abs(int(a) - int(b)) for a, b in zip(str1, str2))

