def get_pairs_count(numbers, target_sum):
    count = 0
    freq = {}

    for number in numbers:
        complement = target_sum - number
        if complement in freq:
            count += freq[complement]

        if number in freq:
            freq[number] += 1
        else:
            freq[number] = 1

    return count

